                    "x": 312.0,
                    "y": 216.0,
                    "data": "\u4e0b\u4e00\u79cd\u6750\u6599\u662f\u65e0\u5c3d\u50ac\u5316\u5242. \u65e0\u5c3d\u50ac\u5316\u5242\u9700\u8981\u75af\u72c2\u5730\u538b\u7f29. \u552f\u4e00\u53ef\u4ee5\u505a\u5230\u7684\u5c31\u662f\u4e2d\u5b50\u6001\u7d20\u538b\u7f29\u673a.\u67e5\u9605\u591a\u65b9\u5757\u7ed3\u6784\u4efb\u52a1\u7ec4\u4e2d\u7684\u4e2d\u5b50\u6001\u7d20\u538b\u7f29\u673a\u4efb\u52a1.</br></br>\u60f3\u8981\u83b7\u5f97\u50ac\u5316\u5242,\u4f60\u9700\u8981\u524d\u5f80\u7ec7\u5973\u5ea7B\u901a\u8fc7\u8d2b\u7620\u77ff\u83b7\u5f97\u7c89. \u7136\u540e\u5c0664\u4e2a\u65e0\u5c3d\u50ac\u5316\u5242\u7c89\u538b\u7f29\u6210\u4e00\u4e2a\u65e0\u5c3d\u50ac\u5316\u5242.</br></br>\u5f53\u7136\u4f60\u60f3\u8bd5\u8bd5\u65e0\u5c3d\u8d2a\u5a6a\u90a3\u4e2a\u75af\u72c2\u7684\u624b\u6413\u65e0\u5c3d\u50ac\u5316\u5242\u7684\u914d\u65b9\u4e5f\u6ca1\u4eba\u62e6\u7740\u4f60,\u6311\u6218\u81ea\u6211\u5427 :P</br></br>[note]\u8fd9\u53f0\u538b\u7f29\u673a\u8fd8\u53ef\u7528\u4e8e\u5236\u9020\u5947\u70b9,\u6700\u7ec8\u5236\u6210\u6c38\u6052\u5947\u70b9.[/note]</br></br>[note]\u5982\u679c\u60f3\u8981\u81ea\u52a8\u5316\u5408\u6210\u5947\u70b9,\u73b0\u5728,\u5728\u6837\u677f\u7ec8\u7aef\u4e2d\u53ef\u4ee5\u7528\u9f20\u6807\u4e2d\u952e\u8c03\u6574\u6837\u677f\u4e2d\u7269\u54c1\u7684\u6570\u91cf,\u8fd9\u53ef\u4ee5\u8d85\u8d8a\u901a\u5e38\u7684\u9650\u5236.[/note]</br></br>\u8bd1\u8005\u6ce8:\u6700\u5927\u53ef\u5230\u6bcf\u683c2.1G.\u611f\u8c22vfyjxf!",
