                    "data": "\u6211\u5728\u4e0d\u8d85\u9891\u7684\u72b6\u6001\u4e0b,\u5df2\u7ecf\u8fbe\u5230\u4e86\u8fd9\u53f0\u591a\u65b9\u5757\u7684\u4e0a\u9650,\u6240\u4ee5\u6211\u89c9\u5f97\u4e3a\u5176\u6dfb\u52a0\u4e00\u5ea7\u6c34\u51b7\u5854,\u4e3a\u5370\u5236\u673a\u6784\u964d\u6e29. \u8fd9\u5ea7\u6c34\u51b7\u5854\u53ef\u4ee5\u8ba9PCB\u5de5\u5382\u8fdb\u884c\u5e38\u89c4\u8d85\u9891,\u5c31\u50cf\u5176\u4ed6\u591a\u65b9\u5757\u673a\u5668\u4e00\u6837,\u901f\u5ea6x2,\u529f\u7387x4.</br></br>\u9700\u8981\u4e3a\u6c34\u51b7\u5854\u7684\u8f93\u5165\u4ed3\u63d0\u4f9b\u84b8\u998f\u6c34,\u4ee5\u5438\u6536\u591a\u4f59\u7684\u70ed\u91cf.</br>%[/note]\u8fd0\u884c\u65f6,\u6c34\u51b7\u5854\u6bcf\u79d2\u6d88\u801710\u5347\u84b8\u998f\u6c34,\u8ba9\u673a\u5668\u8fdb\u884c2/4\u8d85\u9891.\u8f93\u5165\u4ed3\u4f4d\u4e8e\u6c34\u51b7\u5854\u7684\u5e95\u5c42\u4e2d\u592e.[/note]",
