                    "data": "\u8fd9\u91cc\u662f\u4efb\u52a1\u4e66\u6709\u9650\u516c\u53f8. \u5982\u679c\u4f60\u662f\u5408\u6cd5\u73a9\u5230\u8fd9\u91cc\u7684\u8bdd,\u6211\u4eec\u4e25\u91cd\u5173\u5207\u4f60\u7684\u5065\u5eb7. \u4f60\u53ef\u4ee5\u968f\u65f6\u6682\u505c\u6e38\u620f\u51fa\u53bb\u8d70\u8d70,\u4e0d\u662f\u5417?</br></br>\u987a\u4fbf\u4e00\u63d0,\u65e0\u5c3d\u952d\u53ea\u9700\u8981\u624b\u6413\u5373\u53ef\u83b7\u5f97,\u591a\u7b80\u5355\u5440. \u4f60\u5c31\u662f\u5929\u9009\u4e4b\u4eba.</br>%[note]\u73b0\u5728\u4f60\u89e3\u9501\u4e86\u4e00\u7cfb\u5217\u7ec8\u6781\u7269\u54c1\u7684\u5408\u6210. \u67e5\u770b\u7ec8\u6781\u76ee\u6807\u4efb\u52a1\u680f\u6216\u662f\u7ec8\u6781\u5de5\u4f5c\u53f0\u7684NEI\u5408\u6210\u8868,\u4f60\u5c31\u80fd\u77e5\u9053\u8fd9\u4e9b\u7ec8\u6781\u7269\u54c1\u90fd\u662f\u5565\u4e86.[/note]</br></br>[note]\u8fd8\u6709\u4e00\u70b9\u9700\u8981\u6ce8\u610f,\u5f53\u4f60\u9700\u8981\u901a\u8fc7\u7ec8\u6781\u5de5\u4f5c\u53f0\u5927\u91cf\u5408\u6210\u65f6,\u522b\u5fd8\u4e86\u8fd8\u6709\u4e2a\u6781\u9650\u81ea\u52a8\u5408\u6210\u53f0(\u4f60\u4f1a\u9700\u8981\u5b83\u7684).[/note]",
