                    "x": 468.0,
                    "y": 216.0,
                    "data": "\u4f60\u53ef\u80fd\u5df2\u7ecf\u6ce8\u610f\u5230\u4e86,\u751f\u7269\u7535\u8def\u677f\u9700\u8981\u7684\u9cb8\u9c7c\u5ea7\u85fb\u7c7b\u6570\u91cf\u6709\u70b9...\u5938\u5f20.\u5149\u9760\u526a\u5200\u6765\u6536\u96c6\u8fd9\u4e9b\u85fb\u7c7b\u5b9e\u5728\u4ee4\u4eba\u75db\u82e6,\u800c\u8c01\u53c8\u60f3\u4e13\u95e8\u4e3a\u4e86\u526a\u85fb\u7c7b\u4e13\u95e8\u5199\u4e2a\u7a0b\u5e8f\u63a7\u5236\u673a\u5668\u4eba\u4ee3\u52b3\u5462?\u73b0\u5728\u7ec8\u4e8e\u6709\u4e86\u4e00\u79cd\u5de5\u4e1a\u5316\u624b\u6bb5\u751f\u4ea7\u85fb\u7c7b,\u4f55\u5176\u5e78\u8fd0\u554a!</br></br>\u4f60\u9700\u8981\u51c6\u5907\u7684\u7b2c\u4e00\u79cd\u6750\u6599\u662f...\u9cb8\u9c7c\u5ea7\u85fb\u7c7b!\u5c06\u85fb\u7c7b\u914d\u5408\u4ece\u540c\u4e00\u661f\u7403\u62bd\u51fa\u7684\u4e0d\u660e\u6db2\u4f53\u5236\u6210\u5408\u9002\u7684\u57f9\u517b\u76bf.\u51e0\u7387\u540c\u6837\u4f4e\u5f97\u4ee4\u4eba\u53d1\u6307,\u4f60\u8fd8\u9700\u8981\u51c6\u5907\u6700\u9ad8\u7ea7\u7684\u751f\u7269\u5b9e\u9a8c\u5ba4.</br></br>\u62e5\u6709\u57f9\u517b\u76bf\u540e\u4f60\u5c31\u80fd\u5236\u9020\u6d77\u85fb\u57fa\u8d28(SeaweedBroth),\u7531\u672a\u77e5\u8425\u517b\u743c\u8102(UnknownNutrientAgar)\u4e0e\u4e00\u7cfb\u5217\u7269\u54c1\u6df7\u5408\u5236\u6210.\u6700\u540e\u79bb\u5fc3\u5373\u53ef\u83b7\u5f97\u85fb\u7c7b.",
