                    "y": 276.0,
                    "data": "\u78b3\u7eb3\u7c73\u8702\u7fa4\u4f5c\u4e3a\u521d\u59cb\u5de5\u4eba\u5f88\u4e0d\u9519,\u4f46\u5b83\u4eec\u53ea\u6709\u5341\u5206\u57fa\u7840\u7684\u8702\u7fa4\u7f51\u7edc,\u5bf9\u66f4\u590d\u6742\u7684\u7cfb\u7edf\u5c31\u6709\u4e9b\u529b\u4e0d\u4ece\u5fc3\u4e86.\u6240\u4ee5\u60f3\u8981\u751f\u4ea7\u66f4\u590d\u6742\u7684\u7eb3\u7c73\u8702\u7fa4,\u6211\u4eec\u9700\u8981\u4e00\u79cd\u66f4\u52a0\u5148\u8fdb\u7684\u65b0\u578b\u7eb3\u7c73\u8702\u7fa4.</br></br>\u4e2d\u5b50\u7eb3\u7c73\u8702\u7fa4,\u662f1\u9636\u548c2\u9636\u8702\u7fa4\u4e4b\u95f4\u7684\u8fc7\u6e21\u8702\u7fa4,\u8fd8\u6709\u5176\u4ed6\u7528\u9014.</br></br>[note]\u5c06\u4e2d\u5b50\u7eb3\u7c73\u8702\u7fa4\u653e\u5165\u63a7\u5236\u5668\u7684GUI\u540e,\u4f60\u9700\u8981\u7b49\u5f85\u591a\u65b9\u5757\u673a\u5668\u518d\u6b21\u68c0\u67e5\u7ed3\u6784,\u6216\u7b80\u5355\u5730\u62c6\u9664\u63a7\u5236\u5668,\u91cd\u65b0\u653e\u7f6e\u540e\u8fc5\u901f\u585e\u5165\u4e2d\u5b50\u7eb3\u7c73\u8702\u7fa4.\u8fd9\u6837\u7eb3\u7c73\u953b\u7089\u5373\u53ef\u5236\u90202\u9636\u7eb3\u7c73\u8702\u7fa4.[/note]",
