                    "x": 120.0,
                    "y": 120.0,
                    "data": "\u6211\u60f3\u77e5\u9053\u662f\u4e0d\u662f\u56e0\u4e3a\u5b83\u4eec\u57fa\u672c\u4e0a\u5c31\u662f\u5f2f\u66f2\u7684\u5bfc\u7ebf,\u6240\u4ee5\u624d\u662f\u5706\u7684--\u8fd9\u91cc\u9762\u7684\u5bfc\u7ebf\u53ef\u592a\u591a\u4e86.</br></br>\u987a\u4fbf\u4e00\u63d0,\u529b\u573a\u8fd8\u6709\u66f4\u9ad8\u4e00\u7ea7\u7684\u5b58\u5728,\u8bf7\u5230\"\u7ec8\u6781\u76ee\u6807\"\u4efb\u52a1\u680f\u5bfb\u627e\u5b83\u7684\u4efb\u52a1,\u5e76\u5f00\u59cb\u5236\u9020\u4f60\u7684\u00a7k\u6f06\u9ed1\u4f20\u9001\u95e8\u00a7r. \u5b83\u975e\u5e38\u975e\u5e38\u6709\u7528.",
